#include <windows.h>
#include <stdio.h>


int iterate_sections_from_buffer(const unsigned char *buf, size_t bufsize) {
    if (buf == NULL || bufsize < sizeof(IMAGE_DOS_HEADER)) {
        fprintf(stderr, "Buffer inválido o demasiado pequeño\n");
        return 1;
    }

    const IMAGE_DOS_HEADER *dos = (const IMAGE_DOS_HEADER*)buf;
    if (dos->e_magic != IMAGE_DOS_SIGNATURE) {
        fprintf(stderr, "No es un PE válido (MZ missing)\n");
        return 1;
    }

    // Comprueba que e_lfanew cabe en el buffer
    if ((size_t)dos->e_lfanew + sizeof(IMAGE_NT_HEADERS) > bufsize) {
        fprintf(stderr, "Buffer demasiado pequeño para NT headers\n");
        return 1;
    }

    const IMAGE_NT_HEADERS *nt = (const IMAGE_NT_HEADERS*)(buf + dos->e_lfanew);
    if (nt->Signature != IMAGE_NT_SIGNATURE) {
        fprintf(stderr, "Falta la firma PE\n");
        return 1;
    }

    // Determinar arquitectura por OptionalHeader.Magic
    WORD optMagic = nt->OptionalHeader.Magic;
    BOOL is64 = (optMagic == IMAGE_NT_OPTIONAL_HDR64_MAGIC);

    DWORD numberOfSections = nt->FileHeader.NumberOfSections;
    // Puntero al primer IMAGE_SECTION_HEADER:
    const unsigned char *section_ptr = (const unsigned char*)
        (&nt->OptionalHeader) + nt->FileHeader.SizeOfOptionalHeader;

    // Verificar que hay suficiente espacio para los headers de sección
    size_t needed = (section_ptr - buf) + numberOfSections * sizeof(IMAGE_SECTION_HEADER);
    if (needed > bufsize) {
        fprintf(stderr, "Buffer demasiado pequeño para section headers\n");
        return 1;
    }

    const IMAGE_SECTION_HEADER *sections = (const IMAGE_SECTION_HEADER*)section_ptr;

    printf("PE %s. Machine: 0x%04X. Sections: %u. EntryPoint: 0x%08X\n",
           is64 ? "PE32+" : "PE32",
           nt->FileHeader.Machine,
           numberOfSections,
           nt->OptionalHeader.AddressOfEntryPoint);

    for (DWORD i = 0; i < numberOfSections; ++i) {
        char name[9] = {0};
        memcpy(name, sections[i].Name, 8);

        printf("Section %2u: %-8s VA=0x%08X VSize=0x%08X RawOff=0x%08X RawSize=0x%08X Characteristics=0x%08X\n",
               i,
               name,
               sections[i].VirtualAddress,
               sections[i].Misc.VirtualSize,
               sections[i].PointerToRawData,
               sections[i].SizeOfRawData,
               sections[i].Characteristics);
    }

    return 0;
}


